setProperties.example:
This makes an item edible. 
``` 
var EXAMPLE_NUTRITION = 4; 
Item.setProperties(YOUR_OWN_ID_HERE, {
    "use_animation": "eat",
    "use_duration": 32,

    "food": {
      "nutrition": EXAMPLE_NUTRITION,
      "saturation_modifier": "low",
      "is_meat": false
    }
}); 
```

